DROP TABLE IF EXISTS `sys_role`;
CREATE TABLE `sys_role`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '角色id',
  `name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '角色名，用于显示',
  `grade` int(2) NOT NULL DEFAULT -1 COMMENT '级别：1-系统，2-单位，3-部门；',
  `part` int(2) NOT NULL DEFAULT -1 COMMENT '1-管理员；2-审计员；3-业务员',
  `inst_id` int(11) NOT NULL DEFAULT -1 COMMENT '单位ID',
  `dep_id` int(11) NOT NULL DEFAULT -1 COMMENT '部门ID',
  `user_id` int(11) NOT NULL DEFAULT -1 COMMENT '用户ID',
  `rdesc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '角色描述',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `inst_id_id`(`inst_id`) USING BTREE,
  INDEX `dep_id_id`(`dep_id`) USING BTREE,
  CONSTRAINT `dep_id_id` FOREIGN KEY (`dep_id`) REFERENCES `sys_department` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `inst_id_id` FOREIGN KEY (`inst_id`) REFERENCES `sys_institution` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE = InnoDB AUTO_INCREMENT = 25 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '角色' ROW_FORMAT = Compact;

