-- ----------------------------
-- Table structure for sys_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `username` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '登录账号',
  `password` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户密码',
  `real_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '真实姓名',
  `telephone` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '电话',
  `email` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '邮箱',
  `note` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `deadline` datetime(0) NULL DEFAULT NULL COMMENT '失效时间',
  `status` int(1) NOT NULL DEFAULT 1 COMMENT '账号是否有效，0-无效；1-有效；默认1',
  `unique_login` int(11) NOT NULL DEFAULT 1 COMMENT '控制该用户同时登录数量(默认控制登录数为1)：N>=1 登录数量；N<=0 无限制;',
  `part` int(11) NULL DEFAULT 1 COMMENT '1-管理员；2-审计员；3-业务员',
  `inst_id` int(11) NULL DEFAULT NULL COMMENT '单位ID，-1为系统级别',
  `dep_id` int(11) NULL DEFAULT -1 COMMENT '部门ID，默认为-1无部门；',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '最后更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `username`(`username`) USING BTREE,
  INDEX `inst_id`(`inst_id`) USING BTREE,
  INDEX `dep_id`(`dep_id`) USING BTREE,
  CONSTRAINT `dep_id` FOREIGN KEY (`dep_id`) REFERENCES `sys_department` (`id`) ON DELETE SET NULL ON UPDATE RESTRICT,
  CONSTRAINT `inst_id` FOREIGN KEY (`inst_id`) REFERENCES `sys_institution` (`id`) ON DELETE SET NULL ON UPDATE NO ACTION
) ENGINE = InnoDB AUTO_INCREMENT = 162 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统用户表' ROW_FORMAT = Compact;

